  `bmi` varchar(255) NOT NULL,
  `old_bmi` float NOT NULL,
  `medical_history` text NOT NULL,
  `special_comment` text NOT NULL,
  `phone_otp` varchar(8) NOT NULL,
  `phone_otp_date` datetime NOT NULL,
  `phone_number_verify` tinyint(1) NOT NULL DEFAULT 0 COMMENT '1:verify',
